import styled from 'styled-components';

export const ListWrapper = styled.div`
    padding: 10px 0;
    border-bottom: 1px solid #dcdcdc;
    font-size: 20px;    
`;

export const ListInfo =	styled.div`
	width: 500px;
	line-height: 24px;
	font-size: 15px;
    color: #909090;	
`;
